 "<p>Enter the text for the dropdown activity in to the dropdown field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to choose, double click on the word to select it and \nclick on the 'Hide\/Show' button below.<\/p>": "<p>Gegen Sie hier den Text f\u00fcr das Dropdown-Feld der DropDown Aktivit\u00e4t ein\nentweder indem Sie den Text aus einer anderen Quelle kopieren, oder indem Sie ihn direkt in das Feld hineinschreiben. \nf<\/p><p>Um die W\u00f6rter zu definieren, die der Spieler\/die Spielerin erraten soll, doppelklicken Sie auf das Wort und  \nklicken Sie auf die Schaltfl\u00e4che 'Wort verbergen\/anzeigen' unterhalb des Eingabefelds.<\/p>", 
