 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>DropDown Aktivit\u00e4ten sind Texte oder S\u00e4tze, die die Lernenden erg\u00e4nzen, indem sie die richtigen W\u00f6rter ausw\u00e4hlen. Diese Aktivit\u00e4ten werden h\u00e4ufig f\u00fcr folgende Zwecke eingesetzt:<\/p><ol><li>Um das Wissen bez\u00fcglich der Kernaussagen des Kurses zu \u00fcberpr\u00fcfen (z.B. im Rahmen eines Pre-Tests, zur Erhebung w\u00e4hrend des Kursverlaufs oder als Abschlusstest)<\/li><li>Um das Leseverst\u00e4ndnis zu \u00fcberpr\u00fcfen.<\/li><li>Um Vokalen abzufragen<\/li><li>Um Wortbildungs- oder Grammatikkenntnisse zu testen.<\/li><\/ol>", 
 "If you don't choose this option, target field will be empty. Some Computer Aided Translation tools (i.g. OmegaT ) just translate the content of the target field. If you are using this kind of tools, you will need to pre-fill target field with a copy of the source field.": "Wenn Sie diese Option nicht w\u00e4hlen, bleibt das Zielfeld leer. Einige Computer Aided Translation Tools (ig OmegaT)\u00fcbersetzen nur den Inhalt des Zielfeldes. Wenn Sie diese Art von Tools nutzen, m\u00fcssen Sie das Zielfeld vorab mit einer Kopie des Quellfeldes f\u00fcllen. ", 
 "Enter the details of the reading including reference details. The \nreferencing style used will depend on the preference of your faculty or \ndepartment.": "Geben Sie detaillierte Hinweise zu den ausgew\u00e4hlten Lesetexten.\nDie Art der Hinweise h\u00e4ngt vom Kontext Ihres Lernangebotes ab. ", 
 "Add a single text line to an iDevice. Useful if you want the ability to place a label within the iDevice.": "Eine einzelne Textzeile einf\u00fcgen. Hilfreich, um eine \u00dcberschrift einzuf\u00fcgen.", 
 "---Move To---": "---Verschieben nach---", 
 "Unlike the MCQ the SCORM quiz is used to test \nthe learners knowledge on a topic without providing the learner with feedback \nto the correct answer. The quiz will often be given once the learner has had \ntime to learn and practice using the information or skill.\n ": "Anders als beim Multiple-Choice-Test gibt der SCORM-Test\nden Teilnehmer\/innen keine Feedbacks mit Hilfen zur richtigen Antwort.\nDer Test wird h\u00e4ufig dann zur Verf\u00fcgung gestellt, wenn der\/die\nTeilnehmer\/in Zeit hatte, sich vorzubereiten und die Informationen\nund F\u00e4higkeiten bereits erproben konnte.", 
