 "Enter the available choices here. \nYou can add options by clicking the \"Add another option\" button. Delete options by \nclicking the red X next to the option.": "Tragen Sie hier die Auswahloptionen ein.\nWeitere Antworten\nk\u00f6nnen Sie erg\u00e4nzen durch Klick auf den \n\"Eine weitere Option hinzuf\u00fcgen\" Button.\nSie k\u00f6nnen Optionen durch einen Klick auf das \"x\" \nneben der Option l\u00f6schen.", 
