 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU free documentation license.<\/p>": "<p>Das Wikipedia iDevice l\u00e4dt Inhalte aus dem Wikipedia-Lexikon\ndirekt in die Lerneinheit. Es wird eine Kopie des aktuellen Textes\neingef\u00fcgt. Bei Ver\u00e4nderungen in Wikipedia erfolgt keine (!)\nAktualisierung Ihrer Lerneinheit. Dazu m\u00fcssten Sie eine Aktualisierung \nvornehmen. \u00c4nderungen in der Kopie des Wikipedia-Beitrages\nwerden nicht nach Wikipedia \u00fcbertragen.<\/p><p>Wikipedia-Texte werden unter der  GNU Free Documentation\nLizenz ver\u00f6ffentlicht. Sie k\u00f6nnen frei genutzt und\n\u00fcberarbeitet werden.<\/p>", 
