 "Select as many correct answer \noptions as required by clicking the check box beside the option.": "W\u00e4hlen Sie alle richtigen Antworten durch Klick \n auf den Radiobutton aus.", 
 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Beachten Sie bei der Erstellung der Multiple-Choice Fragen folgendes:<ul>\n<li>Verwenden Sie Begriffe, die den Teilnehmer\/innen vertraut sind\noder in der Lerneinheit verwandt wurden.<\/li>\n<li>Formulieren Sie knappe Antwortvorgaben.<\/li>\n<li>Beachten Sie, dass Fragen und Antworten zusammen passen.<\/li>\n<li>Geben Sie ausreichend viele Antwortoptionen, damit dieTeil-\nnehmer\/innen gefordert werden, \u00fcber die richtige Antwort\nnachzudenken.<\/li>\n<li> Achten Sie darauf, dass richtige und falsche Antworten ungef\u00e4hr gleich lang sind.<\/li>\n<li>Falsche Antwortvorgaben sollten falsch sein, aber dennoch \u00fcber eine gewisse\nPlausibilit\u00e4t verf\u00fcgen<\/li>\n<\/ul>\n", 
