 "Reflection is a teaching method often used to \nconnect theory to practice. Reflection tasks often provide learners with an \nopportunity to observe and reflect on their observations before presenting \nthese as a piece of academic work. Journals, diaries, profiles and portfolios \nare useful tools for collecting observation data. Rubrics and guides can be \neffective feedback tools.": "Reflexionen werden h\u00e4ufig benutzt, um eine Verbindung\nzwischen Theorie und Praxis herzustellen. Reflexionsaufgaben\nerm\u00f6glichen vor der Pr\u00e4sentation eines Ergebnisses noch einmal\ndar\u00fcber nachzudenken. Journale, Tageb\u00fccher, Profile und Portfolios\nsind n\u00fctzliche Instrumente um den Reflektionsprozess darzu-\nstellen. Rubriken und Leitlinien sind effektive Feedbackm\u00f6glichkeiten.", 
