 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl> <dt>Wenn Sie das Verst\u00e4ndnis von Konzepten oder das Leseverst\u00e4ndnis testen wollen k\u00f6nnen Sie folgenden Aufgabentyp verwenden<\/dt> <dd><p>Erstellen Sie eine Zusammenfassung des Konzeptes oder des Textes. Sie sollte lang genug sein, um die Kerninhalte darstellen zu k\u00f6nnen, aber nicht so lang, dass es m\u00fchsam wird. H\u00e4ufig ist eine Seite angemessen. Bei j\u00fcngeren Teilnehmer\/innen oder Anf\u00e4nger\/innen kann aber auch weniger angemessen sein.<\/p> <p>W\u00e4hlen Sie Begriffe des Textes aus, die f\u00fcr das Textverst\u00e4ndnis besonders wichtig sind. Das k\u00f6nnen  Nomen, Verben oder Adverbien sein. Geben Sie einen Alternativbegriff mit einem Wort ein.<\/p> <\/dd><dt>Wenn Sie Vokabelkenntnisse \u00fcberpr\u00fcfen wollen:<\/dt> <dd> Erstellen Sie einen Test mit dem abzufragenden Vokabular. Der Text sollte inhaltlich stimmig, in sich abgeschlossen und nicht zu lang sein. Markieren Sie die Kernbegriffe im Text.  W\u00e4hlen Sie eindeutige Alternativbegriffe.<\/dd> <dt>Wenn Sie Grammatikkenntnisse testen wollen:<\/dt> <dd> <p>Erstellen Sie einen Text mit den erfragten Formen. Achten Sie auf Sinnhaftigkeit und Abgeschlossenheit, sowie auf die Textl\u00e4nge. Denken Sie daran, dass es nicht um Vokabelkenntnisse geht. Daher sollten die verwandten Begriffe bereits bekannt sein.<\/p> <p>Markieren Sie die erfragten Begriffe. Geben Sie Alternativbegriffe mit dem selben Wortstamm, aber anderen Endungen ein. Bevor Sie den Test Ihren Teilnehmer\/innen geben, sollten Sie eine\/n Kolleg\/in testen lassen, damit Sie keine \u00dcberraschungen erleben. <\/p>", 
